import React from 'react';
import PropTypes from 'prop-types';


function Myname({name, picture, rating}) {
  return (
    <div> 
      <h1>  I am {name} </h1>
      <h2> {picture} </h2>
      <h3> {rating}</h3>
    </div>
      );
}

Myname.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number,
}

const foodIlike = [

{
  'id': 1,
  'name': 'borsh',
  'image': 'image.com',
  'rating': 4.8
},
{
  'id': 2,
  'name': 'she',
  'image': 'image.com',
  'rating': 3.8
},
]

function renderFood(dish){
  return <Myname name={dish.name} picture={dish.image} rating={dish.rating} />
}

function App() {
  return (
    <div className="App">
      {console.log(foodIlike.map(renderFood))}
      {foodIlike.map(renderFood)}
    </div>
  );
}

export default App;
